alter table `measurement_details`
    add `telephony_network_operator_code` varchar(120);


CREATE TABLE `sim_operator`
(
    id                      bigint(20)   NOT NULL,
    mccmnc                  varchar(7)   NOT NULL,
    valid_from              varchar(30),
    valid_to                varchar(30),
    country                 varchar(2),
    name                    varchar(200) NOT NULL,
    shortname               varchar(100),
    use_for_sim             boolean,
    use_for_network         boolean,
    mcc_mnc_network_mapping varchar(30),
    comment                 varchar(200),
    mapped_uid              bigint(20)
);


